import React from "react";
import Grid from "./Grid.js";
import './style.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
    <Router>
     <div>
       <nav>
         <ul>
           <li>
             <Link to="/contact">Contact Me</Link>
           </li>
         </ul>
       </nav>

       {/* A <Switch> looks through its children <Route>s and
           renders the first one that matches the current URL. */}
       <Switch>
         <Route path="/contact">
           <Contact />
         </Route>
       </Switch>
     </div>
   </Router>

      // <header>
      // <ul class='nav'>
      // <li><a class='active'>Home</a></li>
      // <li>
      //   <Link to="/cotact">Contact Me</Link>
      // // <a href="contact">Contact Me</a>
      // </li>
      // </ul>
      // </header>
  //     <div className="App-header">
  //       <h1 className="name">Joya Jeong</h1>
  //       <div className="intro">I'm a UNSW Information Systems/Commerce student that is an aspiring product
  // and UI designer. Check out some of my work below!</div>
  //     </div>
  //     <Grid />
    </div>
  );
}


function Contact() {
  return <h2>Contact</h2>;
}

export default App;
